            <div id="ShowEcommerceContactInfo">
                Seccion de Contacto
                fsfs
                sffs
            </div>
            <div id="ShowEcommerceRights">
                Todos los derechos reservados
            </div>
            
        </div>
    }
}

export default ShowEcommerceFooter;
